import React, { useState, useEffect } from 'react';
import Papa from 'papaparse';
import MapComponent from './MapComponent';

export default function Home() {
  const [results, setResults] = useState(null);
  const [collisionData, setCollisionData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [isChrome, setIsChrome] = useState(true);
  const [isMobile, setIsMobile] = useState(false);

  
  // Check browser compatibility and screen size
  useEffect(() => {
    const userAgent = navigator.userAgent.toLowerCase();
    setIsChrome(userAgent.includes('chrome') && !userAgent.includes('edge') && !userAgent.includes('opr'));
    setIsMobile(window.innerWidth < 1024);
  }, []);

  // Load collision data from CSV
  useEffect(() => {
    fetch('/collision-data.csv')
      .then((response) => response.text())
      .then((csvText) => {
        Papa.parse(csvText, {
          header: true,
          dynamicTyping: true,
          complete: (result) => {
            setCollisionData(result.data);
            setLoading(false);
          },
        });
      })
      .catch((error) => {
        console.error('Error loading collision data:', error);
        setLoading(false);
      });
  }, []);

  return (
    <div>
      <div className="w-full bg-olive pt-32 py-6 shadow-sm">
        <div className="max-w-7xl mx-auto px-4 text-center">
          <h1 className="font-playfair text-2xl md:text-5xl text-cream">
            Click on the map to select an area and see how much collisions cost Saskatoon
          </h1>
        </div>
      </div>
      <div className="max-w-7xl mx-auto p-4 md:p-8">
        <div className="flex flex-col lg:flex-row gap-8">
          {/* Map Section (Left) */}
          <div className="flex-1 h-[600px] lg:h-[800px]">
            {!isChrome ? (
              <p className="text-red-600 font-semibold">This application works best in Google Chrome. Please switch to Chrome for the best experience.</p>
            ) : isMobile ? (
              <p className="text-red-600 font-semibold">This application is not optimized for mobile. Please use a desktop for the best experience.</p>
            ) : loading ? (
              <p>Loading collision data...</p>
            ) : (
              <MapComponent
                collisionData={collisionData}
                onResultsUpdate={setResults}
              />
            )}
          </div>

          {/* Results Section (Right) */}
{/* Results Section (Right) */}
<div className="w-full lg:w-1/3 bg-white p-6 rounded-lg shadow-md">
  <h2 className="font-playfair text-4xl font-extrabold text-olive mb-6 tracking-wide shadow-sm uppercase">
    Cost Analysis
  </h2>
  <div className="space-y-6">
    {results ? (
      <>
        <div>
          <h3 className="font-semibold text-gray-700 text-lg">Cost of Collisions Per Year</h3>
          <div className="bg-gray-50 p-4 rounded-lg shadow-sm">
            <p className="text-xl font-bold text-gray-900">
              Total: ${Math.round(results.yearly?.total ?? 0).toLocaleString()}
            </p>
            <p className="text-gray-700">
              Direct Costs: <span className="font-bold">${Math.round(results.yearly?.totalDirect ?? 0).toLocaleString()}</span>
            </p>
            <p className="text-gray-700">
              Human Capital: <span className="font-bold">${Math.round(results.yearly?.totalHuman ?? 0).toLocaleString()}</span>
            </p>
            <p className="text-gray-700">
              Willingness to Pay: <span className="font-bold">${Math.round(results.yearly?.totalWtp ?? 0).toLocaleString()}</span>
            </p>
          </div>
        </div>

        <div>
          <h3 className="font-semibold text-gray-700 text-lg">Cost of Collisions Per Day</h3>
          <div className="bg-gray-50 p-4 rounded-lg shadow-sm">
            <p className="text-xl font-bold text-gray-900">
              Total: ${Math.round(results.daily?.total ?? 0).toLocaleString()}
            </p>
            <p className="text-gray-700">
              Direct Costs: <span className="font-bold">${Math.round(results.daily?.totalDirect ?? 0).toLocaleString()}</span>
            </p>
            <p className="text-gray-700">
              Human Capital: <span className="font-bold">${Math.round(results.daily?.totalHuman ?? 0).toLocaleString()}</span>
            </p>
            <p className="text-gray-700">
              Willingness to Pay: <span className="font-bold">${Math.round(results.daily?.totalWtp ?? 0).toLocaleString()}</span>
            </p>
          </div>
        </div>
      </>
    ) : (
      <p className="text-gray-600">Select an area to see the cost analysis.</p>
    )}
  </div>
</div>
        </div>
      </div>
    </div>
  );
}
